import { Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Inicio from './pages/Inicio';
import Novedades from './pages/Novedades';
import Categorias from './pages/Categorias'; 
import Iluminacion from './pages/categorias/Iluminacion';
import Cables from './pages/categorias/Cables';
import Tuberia from './pages/categorias/Tuberia';
import Paneles from './pages/categorias/Paneles';

function App() {
  return (
    <>
      <Navbar />
      <Routes>
        <Route path="/" element={<Inicio />} />
        <Route path="/novedades" element={<Novedades />} />
        <Route path="/categorias" element={<Categorias />} />
        <Route path="/categorias/iluminacion" element={<Iluminacion />} />
        <Route path="/categorias/cables" element={<Cables />} />
        <Route path="/categorias/tuberia y accesorios" element={<Tuberia />} />
        <Route path="/categorias/paneles" element={<Paneles />} />
      </Routes>
    </>
  );
}
